import React from 'react';
import VideoCard from './VideoCard';
import Leaderboard from './Leaderboard';
import { getVideos } from '../services/thetaApi';

const HomePage = () => {
  const videos = [
    { title: 'Video 1', description: 'Description of Video 1' },
    { title: 'Video 2', description: 'Description of Video 2' },
  ];

  const users = [
    { name: 'User 1', points: 100 },
    { name: 'User 2', points: 80 },
  ];

  return (
    <div>
      <h1>Home Page</h1>
      <div className="video-container">
        {videos.map((video, index) => (
          <VideoCard key={index} title={video.title} description={video.description} />
        ))}
      </div>
      <Leaderboard users={users} />
    </div>
  );
};

export default HomePage;
